import React, { Component, useState } from 'react';
import {
  View,
  Platform,
  TextInput,
  FlatList,
  Item,
  Text,
  StyleSheet,
  CheckBox,
  ViewPropTypes,
  Picker,
} from 'react-native';

export default function DrowpDown() {
    const [selectedValue, setValue] = useState("technical")
    return (
        <View>
        <Picker>
            selectedValue={selectedValue}
            onValueChange={(item) => {
                setValue(item)
            }}
            <Picker.Item label="Technical Assessement" value="technical" />
            <Picker.Item label="Cultural Fit" value="cultural" />
            <Picker.Item label="Introduction Call" value="introduction" />
        </Picker>
        </View>
    )
}
